// Navbar.js
import React from 'react';
import './Navbar.css'; // Import CSS file for navbar styles


function Navbar() {
  return (
    <nav className="navbar">
 <div>
 <img src={image1}></img>
 <img src={image2}></img>
 <img src={image3}></img>
 <img src={image4}></img>
 </div>

    </nav>
  );
}

export default Navbar;
